void deleteWord(Node*& head, const wstring& keyword) {
    if (!head) return;

    if (head->data.word == keyword) {
        Node* temp = head;
        head = head->next;
        delete temp;
        return;
    }

    Node* current = head;
    while (current->next && current->next->data.word != keyword) {
        current = current->next;
    }

    if (current->next) {
        Node* temp = current->next;
        current->next = current->next->next;
        delete temp;
    }
}

