            case WM_INITDIALOG:
                pInput = (wstring*)lParam;
                SetDlgItemText(hDlg, IDC_INPUT, pInput->c_str());
                SendDlgItemMessage(hDlg, IDC_INPUT, EM_SETSEL, 0, -1);  // Select all text
